import react from "react";
import ReactDOM from "react";
import { render } from "react-dom";
import { ExpenseList } from "./components/expensesList/expenseList";

const list = [
  {
    id: 1,
    date: new Date(2021, 10, 11),
    title: "House Rent",
    price: 200,
  },
  {
    id: 2,
    date: new Date(2021, 10, 11),
    title: "books",
    price: 100,
  },
  {
    id: 3,
    date: new Date(2021, 10, 11),
    title: "tuetion fee",
    price: 50,
  },
  {
    id: 4,
    date: new Date(2021, 10, 11),
    title: "transport",
    price: 200,
  },
];
export const App = () => {
  const date1 = new Date(2021, 11, 10);

  return <ExpenseList date={date1} />;
};
